import React from "react";


export default class Bill extends React.Component {
    render() {
        let summary = this.props.summary.map(item => {
            return (
                <div>
                    <h4>Fish Name: {item.fishname}</h4>
                    <p>
                        Order No: {item.order} <br />
                        <span>{item.price}</span>
                    </p>
                </div>
            );
        })
        return (
            <div>
                <h1>Bill Summary</h1>
                {summary}
            </div>
        );
    }
}
